import React from 'react';
import { Router, Route, Routes } from 'react-router-dom';

import Home from '../Home';
import About from './About';
import AbsExercise from './AbsExercise';
import ChestExercise from './ChestExercise';
import DumbellExercise from './DumbellExercise';
import FullbodyExercise from './FullbodyExercise';
import LegsExercise from './LegsExercise';

import Header from './Header';



const App = () => {
    return(
        <div>
            <div> 
                <Header />
                <Routes>
                    <Route path="/" exact component={Home}/>
                    <Route path="/about" exact component={About}/>
                    <Route path="/abs" exact component={AbsExercise}/>
                    <Route path="/chest" exact component={ChestExercise}/>
                    <Route path="/dumbell" exact component={DumbellExercise}/>
                    <Route path="/fullbody" exact component={FullbodyExercise}/>
                    <Route path="/legs" exact component={LegsExercise}/>
                </Routes>
            </div>
        </div>
    )
}

export default App
